  true,\n\t\"url\": null,\n\t\"notes\": \"The Solar Spectral Flux Radiometer (SSFR)
  was deployed on the University of Washington CV-580 during the dry season component
  of the Southern African Regional Science Initiative, August 1 - September 20, 2000.
  The SSFR made simultaneous measurements of both downwelling and upwelling net solar
  spectral irradiance at varying flight levels.  Data have been provided for twenty
  flights in netcdf format for the period August 17 - September 16, 2000.For a complete
  detailed guide to the extensive measurements obtained aboard the UW Convair-580
  aircraft in support of SAFARI 2000, see the UW Technical Report for the SAFARI 2000
  Project.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
